import React from "react";
import { Nav } from "react-bootstrap";
import { NavLink } from "react-router-dom";

function SideBar(){

  const menus = [
    {name : "머니 충전", path: "/main"},
    {name : "머니 결제", path: "/main/payCash"},
    {name : "거래내역", path: "/main/payHistory"},
  ]
    return(
    <nav>
      <Nav defaultActiveKey={"/main"} className="flex-column">
          {menus.map((menu, idx) => {
            return(
              <Nav.Link key={idx} afterstyle={{color:"black"}} href={menu.path}>{menu.name}</Nav.Link>
            );
          })}
          
      </Nav>
    </nav>
    )
}

export default SideBar;
